import React, { useEffect, useState } from 'react';
import { NavLink } from 'react-router-dom'; // Import NavLink
import {
  Bar,
  BarChart,
  CartesianGrid,
  Legend,
  ResponsiveContainer,
  Tooltip,
  XAxis,
  YAxis,
} from 'recharts';
import './Land.css';

const Land = () => {
  // State to hold data and loading status
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  // Simulate fetching data from an API
  useEffect(() => {
    // Simulated API call (replace this with real data fetching logic)
    setTimeout(() => {
      const fetchedData = [
        { name: 'Orman01 ', quantity: Math.floor(Math.random() * 20) + 80 },
        { name: 'Orman01', quantity: Math.floor(Math.random() * 20) + 90 },
        { name: 'Orman01', quantity: Math.floor(Math.random() * 20) + 50 },
      ];
      setData(fetchedData);
      setLoading(false); // Data fetching done
    }, 2000); // Simulate 2 seconds of loading time
  }, []);

  return (
    <div className="dashboard-container">
      {/* Search bar section */}
      <div className="search-container">
        <input 
          type="text" 
          placeholder="Orma_00001" 
          className="search-input" 
        />
        <button className="search-button">Search</button>
      </div>

      {/* Filters section */}
      <div className="filters-container">
        <input type="text" placeholder="State id" />
        <input type="text" placeholder="District id" />
        <input type="text" placeholder="FPO id" />
        <input type="text" placeholder="Crop id" />
        <input type="text" placeholder="Farmer id" />
      </div>

      {/* Chart section */}
      <div className="chart-container">
        <h3>Land Under Jurisdiction</h3>
        {loading ? (
          <p>Loading data...</p> // Loading indicator
        ) : (
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={data} margin={{ top: 100, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="quantity" fill="#8B4513" barSize={40} />
            </BarChart>
          </ResponsiveContainer>
        )}
      </div>

      {/* Link to About page */}
      <div className="redirect-link">
        <NavLink to="/home">Go to Home Page</NavLink> {/* NavLink for redirection */}
      </div>
    </div>
  );
};

export default Land;
